To produce a list of tests in the JSON output format cargo nextest list --message-format json (or json-pretty for nicely formatted output). Here's some example output for the tokio repository : % cargo nextest list -p tokio-util --features full --lib --format json-pretty
{ "test-count": 4, "rust-suites": { "tokio-util": { "package-name": "tokio-util", "binary-name": "tokio-util", "package-id": "tokio-util 0.7.0 (path+file:///home/me/dev/tokio/tokio-util)", "binary-path": "/home/me/dev/tokio/target/debug/deps/tokio_util-def0ee51cb418fe8", "cwd": "/home/rain/dev/tokio/tokio-util", "build-platform": "target", "testcases": { "either::tests::either_is_async_read": { "ignored": false, "filter-match": { "status": "matches" } }, "either::tests::either_is_stream": { "ignored": false, "filter-match": { "status": "matches" } }, "time::wheel::level::test::test_slot_for": { "ignored": false, "filter-match": { "status": "matches" } }, "time::wheel::test::test_level_for": { "ignored": false, "filter-match": { "status": "matches" } } } } }
} The value of "package-id" can be matched up to the package IDs produced by running cargo metadata.
